caption:
Fourth holiday make-up 🖤✨

Christmas has passed and we’ re preparing to say goodbye to 2022 to welcome the new year. 🎆🎇
This time I wanted to "play" with a color that I don't use frequently: black. 🖤
Combined with gold I find it gorgeous, I also really like this shade of green (it's a chrome gold eyeshadow duo with green reflections). 😍✨

